import "./App.css";
import "./styles.scss";
import { Route, Redirect, Switch, BrowserRouter } from "react-router-dom";
import RenderComponent from "./components/RenderComponent/RenderComponent";
const App = () => {
  const findMedianSortedArrays = (nums1: number[], nums2: number[]): number => {
    let mergeArray = [...nums1, ...nums2];
    mergeArray.sort();
    let length = mergeArray.length;
    if (length === 1) {
      return mergeArray[0];
    } else if (length % 2 === 0) {
      console.log((mergeArray[length / 2] + mergeArray[length / 2 + 1]) / 2);
      return (mergeArray[length / 2] + mergeArray[length / 2 + 1]) / 2;
    } else {
      console.log(mergeArray[length / 2 - 0.5]);
      return mergeArray[length / 2 - 0.5];
    }
  };
  findMedianSortedArrays([2, 3], [1, 4]);
  return (
    <>
      <link rel="preconnect" href="https://fonts.googleapis.com"></link>
      <link rel="preconnect" href="https://fonts.gstatic.com"></link>
      <link
        href="https://fonts.googleapis.com/css2?family=Rampart+One&display=swap"
        rel="stylesheet"
      ></link>
      <BrowserRouter>
        <Switch>
          <Route component={RenderComponent}></Route>
        </Switch>
      </BrowserRouter>
    </>
  );
};

export default App;
